import React from "react";

export const DefButton = (p) => {
  return (
    <button
      onClick={p.onClick}
      className="rounded-md p-2 px-2.5 text-black dark:text-white dark:bg-black bg-white AXASV "
    >
      {p.label}
    </button>
  );
};
export const DefMenus = (p) => {
  return (
    <div className="flex border-b ">
      {p.menus.map((e, i) => (
        <div
          key={i}
          className={
            p.SelectedMenu == i
              ? "-mb-[1.1px] border-b-2 dark:border-black border-white"
              : "-mb-[1.1px] border-b-2 border-transparent"
          }
        >
          <button
            className={
              "text-sm  font-semibold px-2 py-1 my-1 mx-1 w-fit hover:dark:bg-[#38352f11]  hover:bg-[#fff3] rounded-md"
            }
            id={i}
            name={e.name}
            onClick={(ee) => p.setSelectedMenu(ee.target.id)}
          >
            <e.icon className=" -mt-1 mr-1  scale-[0.8] " />
            {e.label}
          </button>
        </div>
      ))}
    </div>
  );
};

